import './main.css';


import React from "react";


import groceries from './images/main/groceries1.png';
import household from './images/main/household.png';
import basket from './images/main/basket.png';
console.log(groceries)

function Main() {
  return (
    <div className="container">

      <main className='container vertical-centre'>
          <div className='row top2 centre'>
              <h1>Estia</h1>
          </div>

          <div className='row  centre top1'>              
              <button className='col centre' id='main-button1'>
                <label className='full centre'><b>Groceries</b></label>  
                <img className='Main-img top1' src={groceries} alt='groceries'></img>
              </button>
              {/* <div className='col-1 border centre vertical-centre fas fa-bell'></div>               */}
          </div>


          <div className='row centre top1'>

              <button className='col centre' id='main-button2'>
                <label className='full centre'><b>Household</b></label>  
                <img className='Main-img top1' src={household} alt='groceries'></img>
              </button>
              {/* <div className='col-1 border centre vertical-centre fas fa-bell'></div>               */}
          </div>



          <div className='row centre top1'>
          <button className='col centre' id='main-button3'>
                <label className='full centre'><b>Shopping list</b></label>  
                <img className='Main-img top1' src={basket} alt='groceries'></img>
              </button>             
          </div>






      </main>




    </div>
  );
}

export default Main;
